import axios from "axios";
import ApiURL from "../../global/ApiURL";
import { IUser } from '../../global/interfaces'

export default async function RegisterUser (user: IUser) {
  try {
    const send = await axios({
      method: 'post',
      url: `${ApiURL}/users`,
      data: user
    })
    return send.status
  } catch (e) {
    return e
  }
}
